how_on_front\": {\n        \"value\": \"page\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2017-12-17 02:45:21\"\n    }\n}','','','trash','closed','closed','','5ba8651c-4b00-4f2d-b78b-195afeb96246','','','2017-12-17 02:45:21','2017-12-17 02:45:21','',0,'http://sil-asia.local/?p=41',0,'customize_changeset','',0),(42,1,'2017-12-17 02:49:52','2017-12-17 02:49:52','<h1><strong>Who are we?</strong></h1>\nWe are the Standards and Interoperability Lab for Asia. We are established by AeHIN with support from WHO, UNICEF, NORAD, ADB, and other development partners to serve the interoperability needs of Asian countries. We are located at the Philippine General Hospital, University of the Philippines Manila.\n<h1>Our Goal</h1>\nOur primary goal is to provide the technical assistance to public and private organizations with their efforts to make their eHealth systems interoperable. Whether is it for universal health coverage, non-communicable diseases. disaster management or infectious disease control, SIL-Asia will assists countries\n\n&nbsp;','About the Lab','','inherit','closed','closed','','17-autosave-v1','','','2017-12-17 02:49:52','2017-12-17 02:49:52','',17,'http://sil-asia.local/2017/12/17/17-autosave-v1/',0,'revision','',0),(43,1,'2017-12-17 02:51:20','2017-12-17 02:51:20','<h1><strong>Who are we?</strong></h1>\r\nWe are the Standards and Interoperability Lab for Asia. We are established by AeHIN with support from WHO, UNICEF, NORAD, ADB, and other development partners to serve the interoperability needs of Asian countries. We are located at the Philippine General Hospital, University of the Philippines Manila.\r\n<h1>Our Goal</h1>\r\nOur primary goal is to provide the technical assistance to public and private organizations with their efforts to make their eHealth systems interoperable. Whether is it for universal health coverage, non-communicable diseases. disaster management or infectious disease control, SIL-Asia will assists countries build capacity to interconnect their existing systems using international standards.\r\n<h1>What do we do?</h1>\r\nOur technical assistance includes ASSESSMENT (AeHIN\'s Mind the GAPS) followed by TEAMING, TESTING, TOOLING, and TRAINING. We especially help governments connect their existing information systems to assist in planning and decision-making.\r\n\r\nGAPS stand for governance, architecture, program management, standards/interoperability. We believe these are the core enablers of national eHealth systems and map with the WHO-ITU National eHealth Startegy Toolkit.\r\n<h1>How can we help you?</h1>\r\nYou may send us an email<a class=\"external-link\" href=\"mailto:sil-asia@aehin.net\" rel=\"nofollow\">sil-asia@aehin.net</a>\r\n\r\nComing soon: AeHIN\'s Fill the GAPS Catalog\r\n\r\n&nbsp;','About the Lab','','inherit','closed','closed','','17-revision-v1','','','2017-12-17 02:51:20','2017-12-17 02:51:20','',17,'http://sil-asia.local/2017/12/17/17-revision-v1/',0,'revision','',0),(44,1,'2017-12-17 02:57:40','2017-12-17 02:57:40','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://sil-asia.local/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','inherit','closed','closed','','2-revision-v1','','','2017-12-17 02:57:40','2017-12-17 02:57:40','',2,'http://sil-asia.local/2017/12/17/2-revision-v1/',0,'revision','',0),(45,1,'2017-12-17 02:58:03','2017-12-17 02:58:03','','Lab Members','','publish','closed','closed','','lab-members','','','2017-12-17 02:58:03','2017-12-17 02:58:03','',0,'http://sil-asia.local/?page_id=45',0,'page','',0),(46,1,'2017-12-17 02:58:03','2017-12-17 02:58:03','','Lab Members','','inherit','closed','closed','','45-revision-v1','','','2017-12-17 02:58:03','2017-12-17 02:58:03','',45,'http://sil-asia.local/2017/12/17/45-revision-v1/',0,'revision','',0),(47,1,'2017-12-17 02:58:21','2017-12-17 02:58:21','','Projects','','publish','closed','closed','','projects','','','2017-12-17 02:58:21','2017-12-17 02:58:21','',0,'http://sil-asia.local/?page_id=47',0,'page','',0),(48,1,'2017-12-17 02:58:21','2017-12-17 02:58:21','','Projects','','inherit','closed','closed','','47-revision-v1','','','2017-12-17 02:58:21','2017-12-17 02:58:21','',47,'http://sil-asia.local/2017/12/17/47-revision-v1/',0,'revision','',0),(49,1,'2017-12-17 02:58:25','2017-12-17 02:58:25','','Funders','','publish','closed','closed','','funders','','','2017-12-17 02:58:25','2017-12-17 02:58:25','',0,'http://sil-asia.local/?page_id=49',0,'page','',0),(50,1,'2017-12-17 02:58:25','2017-12-17 02:58:25','','Funders','','inherit','closed','closed','','49-revision-v1','','','2017-12-17 02:58:25','2017-12-17 02:58:25','',49,'http://sil-asia.local/2017/12/17/49-revision-v1/',0,'revision','',0),(51,1,'2017-12-17 02:58:34','2017-12-17 02:58:34','','Products','','publish','closed','closed','','products','','','2017-12-17 02:58:34','2017-12-17 02:58:34','',0,'http://sil-asia.local/?page_id=51',0,'page','',0),(52,1,'2017-12-17 02:58:34','2017-12-17 02:58:34','','Products','','inherit','closed','closed','','51-revision-v1','','','2017-12-17 02:58:34','2017-12-17 02:58:34','',51,'http://sil